.primo-copy {
  font-size: 1.125rem;
  line-height: 1.75rem;
  --tw-text-opacity: 1;
  color: rgba(55, 65, 81, var(--tw-text-opacity));
}

.primo-copy h1 {
    font-weight: 500;
    font-size: 1.875rem;
    line-height: 2.25rem;
  }

.primo-copy h2 {
    font-weight: 500;
    font-size: 1.5rem;
    line-height: 2rem;
  }

.primo-copy ol {
    list-style-type: decimal;
  }

.primo-copy ul {
    list-style-position: inside;
    list-style-type: disc;
  }

.primo-copy ul p {
      display: inline;
    }

.primo-copy ol {
    list-style-position: inside;
    list-style-type: decimal;
  }

.primo-copy a {
    --tw-text-opacity: 1;
    color: rgba(37, 99, 235, var(--tw-text-opacity));
    text-decoration: underline;
  }

.primo-copy blockquote {
    padding: 1.5rem;
    --tw-shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -1px rgba(0, 0, 0, 0.06);
