  }

.primo-copy mark {
    --tw-bg-opacity: 1;
    background-color: rgba(253, 230, 138, var(--tw-bg-opacity));
    --tw-text-opacity: 1;
    color: rgba(17, 24, 39, var(--tw-text-opacity));
  }

@media (min-width: 1024px) {
    .primo-copy h1 {
      font-size: 3rem;
      line-height: 1;
    }

